import { Container, Row, Col } from "react-bootstrap";
import contactImg from "../assets/img/contact-image.png";
import 'animate.css';
import TrackVisibility from 'react-on-screen';
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPhone, faEnvelope } from "@fortawesome/free-solid-svg-icons";
import { faLinkedin } from "@fortawesome/free-brands-svg-icons";

export const Contact = () => {
  return (
    <section className="contact" id="connect">
      <Container>
        <Row className="align-items-center">
          <Col size={12} md={6}>
            <TrackVisibility>
              {({ isVisible }) =>
                <img
                  className={isVisible ? "animate__animated animate__zoomIn" : ""}
                  src={contactImg}
                  alt="Contact Us"
                />
              }
            </TrackVisibility>
          </Col>
          <Col size={12} md={6}>
            <TrackVisibility>
              {({ isVisible }) => (
                <div className={isVisible ? "animate__animated animate__fadeIn" : ""}>
                  <h2>Contact Me</h2>
                  <Row className="contact-icons">
                    <Col size={12} className="px-1">
                      <p>
                        <FontAwesomeIcon icon={faPhone} />{' '}
                        <a href="tel:+9196336405">+91 96336 405</a>
                      </p>
                    </Col>
                    <Col size={12} className="px-1">
                      <p>
                        <FontAwesomeIcon icon={faEnvelope} />{' '}
                        <a href="mailto:prashanthikoudi@gmail.com">prashanthikoudi@gmail.com</a>
                      </p>
                    </Col>
                    <Col size={12} className="px-1">
                      <p>
                        <FontAwesomeIcon icon={faLinkedin} />{' '}
                        <a
                          href="https://www.linkedin.com/in/prashanthi-koudi/"
                          target="_blank"
                          rel="noopener noreferrer"
                        >
                          LinkedIn Profile
                        </a>
                      </p>
                    </Col>
                  </Row>
                </div>
              )}
            </TrackVisibility>
          </Col>
        </Row>
      </Container>
    </section>
  );
};
